import React from "react";
import '../styles.css';
import AuthButton from "../components/AuthButton";
// ^This will be used to link to the sign up page

function Login() {
    var pass = "";
    function handleChange() {
        AuthButton.isAuthenticated = true;
    }
    return (
        <div className = 'page-container'>
            <div className="page-text">
                <h1>Please Log In Below</h1>
                <br/>
                <div className = 'accountblock'>
                    <br/>
                    <br/>
                        <input placeholder="Username"/>
                        <input placeholder="Password" onChange={handleChange()} value={pass}/>
                        <button type="submit" id="submitBtn" className="submitBtn" onClick={handleChange()}>Submit</button>
                        { AuthButton.isAuthenticated }
                </div>
            </div>
        </div>
    )
}

export default Login;
